import React, { useState } from 'react'

const Login = () => {
    const [username,setUsername]=useState('');
    const [password,setpassword]=useState('');
   function Update(e){
    if(e.name===username)
       setUsername(e.targtet.value);
    if(e.name===password)
       setpassword(e.targtet.value);
    console.log(username);
    console.log(password)
   }

  return (
    

    <>
      <div className="login_container">
        <div className="login_items">
            <form action="">
                <input type="text" name='username' placeholder='Enter your username or gmail' value={username} onChange={Update}/>
                <input type="text" name='password' placeholder='Password' value={password} onChange={Update}/>
            </form>
        </div>
      </div>
    </>
  )
}

export default Login
